import React from 'react';
import {Component} from 'react';
import Webcam from 'react-webcam';

class Camera extends Component {

    constructor() {
        super();
        this.handlSpacePress = this.handleSpacePress.bind(this);
    }


    handleSpacePress(e) {
        if (e.keyCode === 32) {
            console.log("Success");
        }
    }

    render() {
        return (
            <div>
                <Webcam
                    audio = {false}
                    height = {1000}
                    width = {1000}
                    screenshotFormat = "image/png"
                />
                <input onKeyPress={this.handleSpacePress}/>
            </div>
        )
    }
}

export default Camera;
